import sys
import threading

# Fast input
def input():
    return sys.stdin.readline()

# Constants
INF = int(1e9)
LL_INF = int(1e18)
MOD = int(1e9 + 7)

# Aliases
def scan_ints(): return list(map(int, input().split()))
def printarr(arr): print(' '.join(map(str, arr)))
def printerr(*args, **kwargs): print(*args, file=sys.stderr, **kwargs)

# Main logic per test case
def solve():
    a, b = scan_ints()
    print(a + b)
    return

# Main wrapper
def main():
    t = 1
    # t = int(input())
    for _ in range(t):
        solve()

# Fast execution and recursion safety
if __name__ == "__main__":
    threading.Thread(target=main).start()